  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Swan Lake NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Swan Lake NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, information about the environment, goals
  and objectives, and strategies for implementation. Key planning issues include:
  Canada geese, water quality, ecological integrity, visitor services, and fishing.\",\n\t\"owner_org\":
